      SELECT * FROM tab2 (FORMAT parquet) cor0 WHERE - 16 * - 35 BETWEEN + + ( + 31 ) AND col0 * col1;
  - name: tab2

outputs:
  - name: q2334.out
    data: |
      46	51	23
      64	77	40
      75	67	58
